import { __decorate } from "tslib";
import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from "@angular/core";
import { FormsModule } from "@angular/forms";
import { MatGridListModule } from "@angular/material/grid-list";
import { WordleLetterComponent } from "./word-letter/wordle-letter.component";
import { WordleGridComponent } from "./wordle-grid/wordle-grid.component";
import { CommonModule } from "@angular/common";
let WordleMainModule = class WordleMainModule {
};
WordleMainModule = __decorate([
    NgModule({
        declarations: [
            WordleLetterComponent,
            WordleGridComponent,
        ],
        exports: [WordleLetterComponent, WordleGridComponent],
        imports: [
            CommonModule,
            FormsModule,
            MatGridListModule
        ],
        providers: [],
        schemas: [
            CUSTOM_ELEMENTS_SCHEMA,
        ],
    })
], WordleMainModule);
export { WordleMainModule };
